{{Short description|Maldivian politician}}
''' Dr.Abdulla Khaleel''' is a [[Maldivians|Maldivian]] politician and incumbent Minister of Health, born on 15 February 1975.<ref>{{Cite web |title=Health |url=https://health.gov.mv/en/executives |access-date=2023-11-18 |website=MinistryOfHealthMV |language=en}}</ref> Dr. Abdulla Khaleel had previously served as [[Nilandhoo (Faafu Atoll)|Nilandhoo]] MP, as well as Director General at the Civil Service Commission, and Secretary General at PPM. He even holds a PhD in Public Policy.<ref>{{Cite web |last=Nov 17 |first=0 |last2=2023 19:31 |title=Dr. Muizzu’s promising cabinet |url=https://en.sun.mv/85974 |access-date=2023-11-18 |website=SunOnline International |language=en}}</ref>
